 - "\\": [T: "abrir corchetes"]              	#  0x5c	(en: 'back slash', MathPlayer: 'abre corchetes', google: 'back slash')
 - "]":                                         	#  0x5d
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: "cerrar soporte"]          	# 	(en: 'close bracket', google translation)
        else: [T: "cerrar corchetes"]           	# 	(en: 'right bracket', MathPlayer: 'cierra corchetes', google: 'soporte derecho')
 - "^": [T: "circunflejo"]                      	#  0x5e	(en: 'hat')
 - "_": [T: "subrayado"]                        	#  0x5f	(en: 'under bar')
 - "`": [T: "acento grave"]                     	#  0x60	(en: 'grave accent')
 - "{":                                         	#  0x7b
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: "abrir corchetes"]         	# 	(en: 'open brace', google translation)
        else: [T: "abrir llave"]            	# 	(en: 'left brace', MathPlayer: 'abre llaves', google: 'abrazadera izquierda')
 - "|":                                         	#  0x7c
    # note: for ClearSpeak and SimpleSpeak, "|" inside of sets is handled at the mrow level, same for 'sets'
     - test:
        - if: $SpeechStyle != 'ClearSpeak'
          then: [T: "línea vertical"]           	# 	(en: 'vertical line', google translation)
        - else_if: "$ClearSpeak_VerticalLine = 'SuchThat'"
          then: [T: "tal que"]                  	# 	(en: 'such that', google translation)
        - else_if: "$ClearSpeak_VerticalLine = 'Given'"  
          then: [T: "dado"]                     	# 	(en: 'given', google translation)
        - else: [T: "barra vertical"]           	# 	(en: 'divides')

 - "}":                                         	#  0x7d
    - test:
        if: $SpeechStyle = 'ClearSpeak' or $SpeechStyle = 'SimpleSpeak'
        then: [T: "cerrar corchetes"]          	# 	(en: 'close brace', google translation)
        else: [T: "abrir llave"]             	# 	(en: 'right brace', MathPlayer: 'cierra llaves', google: 'abrazadera derecha')

